import React, { Fragment } from "react";

type props = {
    todoItem: any
}

const TodoList: React.FC<props> = React.memo(props => {

    const { todoItem } = props;


    return (
        <Fragment>

            <li style={{ textDecoration: todoItem.checked ? "line-through" : "none" }}>{todoItem.name}</li>
        </Fragment >
    )
})

export default TodoList;
